import { createTheme, ThemeProvider } from "@mui/system";
import { LightSwitch } from "./components/LightSwitch";

const customTheme = createTheme({
  palette: {
    primary: {
      main: "#1976d2",
      contrastText: "white",
    },
    bulbs: {
      on: "#8CBBE9",
      off: "#ECECEC",
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={customTheme}>
      <h1>IoT Hydroponics Project</h1>
      <LightSwitch />
    </ThemeProvider>
  );
}

export default App;
